import {Header} from '../components/organisms'
import { useState } from 'react';

const Page = () => {
    const [item, setItem] = useState([
        {
            "title": "Issues",
            "url": "/issues"
        },
        {
            "title": "Stories",
            "url": "/stories"
        },
        {
            "title": "About us",
            "url": "about"
        }
    ])
    return (
        <>
        <Header/>
        <p>Home</p>
        </>
    )
}

export default Page;
